<html lang="en">

<head>
  <meta charset="utf-8">
  <meta name="viewport" content="width=device-width, user-scalable=no, initial-scale=1.0, maximum-scale=1.0, minimum-scale=1.0">
  <title></title>
  <style>
    @keyframes rotate{
      0%{
          transform: rotate(0deg);
      }
      50%{
          transform: rotate(180deg);
      }
      100%{
          transform: rotate(360deg);
      }
  }
    .loading-container {
        position: fixed;
        left: 0;
        top: 0;
        bottom: 0;
        right: 0;
        display: flex;
        align-items: center;
        justify-content: center;
    }
    .loading{
        border-radius: 10px;
        position: relative;
        text-align: center;
        height: 56px;
        width: 56px;
        z-index: 888;
        
    }
    
    .loading-back-rotate {
        height: 100%;
        width: 100%;
        border-radius: 10px;
        font-size: 0;
        background-color: #FCC000;
        animation: rotate 1.5s infinite ;
    }
    .img-container {
        position: absolute;
        left: 0;
        bottom: 0;
        width: 100%;
        height: 100%;
        background-size: 100%;
        transform-origin: bottom;
        background-position: bottom;
        z-index: 999;
    }

  </style>
